import './MainPage.css';
import { Link, Navigate } from 'react-router-dom'
import { useSelector } from 'react-redux'
import { AppState } from '../../state/reducers/root'


import Navbar from './inner/Navbar/Navbar'
import OpenGame from './inner/OpenGame/OpenGame'

export default function MainPage(props: any) {
  const username: string | null = useSelector((state: AppState) => state).authentication.username

  /*
  function renderLoginIfNotLogged() {
    if (username == null)
      return <Navigate to="/login" replace />
  }

  Inside Return Div Container: {renderLoginIfNotLogged()}
  */


  //style="display: block; width: 535px; top: 10px; right: 10px; bottom: unset; left: unset; transform: unset;"
  const styles = {
    display: "block",
    width: "535px",
    top: "10px",
    right: "10px",
    bottom: "unset",
    left: "unset",
    transform: "unset"
  }

  return (
    <div>
      <div style={styles} className="alert fade alert-danger alert-fixed show" id="alert-danger" role="alert" data-mdb-color="danger" data-mdb-position="top-right" data-mdb-stacking="true" data-mdb-width="535px" data-mdb-append-to-body="true" data-mdb-hidden="true" data-mdb-autohide="true" data-mdb-delay="2000" >
        A simple danger alert with
      </div>
      <Navbar />
      <div className="container main-page-contents">
        <div className="row justify-content-md-center">
          <div className="col open-game-outer-container">
            <OpenGame />
          </div>
        </div>
      </div>
    </div>
  );
}
